import React, { useState } from 'react'
import Search from './Search'
import UserList from './UserList/UserList'

export default () => {
  const [result, setResult] = useState()
  return (
    <>
      <Search
        className="ba b--light-gray mb4 pa2 w-100"
        onResult={value => setResult(value)}
      />
      <UserList {...result} />
    </>
  )
}
